import React, {useState} from 'react';
import ReactDOM from 'react-dom';
import Taoanh from "./taoasnav";
import contact from './contacts'
var lp = window.location.pathname.slice(1)
lp = lp.replace(/%20/g, " ")
function createCardzz(contact) {
    if (contact.name == lp)
    return (
      <Taoanh
      hinh = {contact.hinh}
       />
    )
}
  function Galerry() {
    return (
        <div>
        {contact.hinh.map(x => <h2>{x}</h2>)}
        </div>
    )
  }

export default Galerry
